import React from 'react';
import { Container } from 'react-bootstrap';

function Competence() {
  return (
    <section id="competence" className="py-5">
      <Container>
        <h2 className="mb-4">Compétences Humaines et Informatique </h2>

        <h5>Qualités Personnelles</h5>
        <p>
        Mes différentes expériences m'ont permis de développer des qualités humaines fortes : le goût de la transmission, l’écoute active, l’envie d’aider les autres et un sens du leadership.
Je sais assumer des décisions, les justifier de manière cohérente, et les communiquer clairement.

Je suis une personne dynamique, proactive, avec un fort esprit d’initiative, appréciant particulièrement la résolution de problèmes et la gestion de projets.
Sérieux, ponctuel et orienté vers le travail en équipe, je valorise autant les compétences techniques que les relations humaines.</p>

        <h5>Stage Dév. POC Jeux Vidéo – BEMS</h5>
        <p><em>Août - Septembre 2025</em><br />
        Programmation de jeux, prototypage, gestion de projet en équipe, optimisation technique.</p>

        <h5>Secrétaire – Cabinet d’Ophtalmologie PardYeux</h5>
        <p><em>Septembre 2024</em><br />
        Accueil des patients, gestion des rendez-vous, dossiers médicaux et appels téléphoniques.</p>
      </Container>
    </section>
  );
}

export default Competence;
